import React from "react";

export const strings = {
  title: {
    nl: "Quaranteinde",
    fr: "Fin quarantaine"
  },
  description: {
    nl: "",
    fr: ""
  },
  heading: {
    nl: "tot het einde van de quarantaine",
    fr: ""
  },
  disclaimer: {
    nl: "(wordt geupdate met gegevens van de betrokken ministeries)",
    fr: ""
  },
  credit: {
    nl: (
      <a href="https://broddin.be" target="_blank">
        door Tim Broddin
      </a>
    ),
    fr: (
      <a href="https://broddin.be" target="_blank">
        door Tim Broddin
      </a>
    )
  }
};
